(def n 40)
(def r (nth (map :genotype (sort-by :complexity (:elite result))) n))
(tree/count-nodes r)
(def rr (grammar-replace r))
(tree/count-nodes rr)

r

(lagrangian/lagrange-score-mmd-inspector
  (lagrangian/prepare-lagrange-mmd-data dat t-step '[theta1 theta2])
